import React, { Component } from "react";
import "../Cssfile/Dashboard.css";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import InputBase from "@material-ui/core/InputBase";
import keeplogo from "../image/keeplogo.png";
import setting from "../image/setting.svg";
import keep1 from "../image/1.svg";
import keep2 from "../image/2.svg";
import MenuIcon from "@material-ui/icons/Menu";
import SearchIcon from "@material-ui/icons/Search";
import AccountCircle from "@material-ui/icons/AccountCircle";
import Drawer from "./Drawer";
import SettingsOutlinedIcon from "@material-ui/icons/SettingsOutlined";
import RefreshOutlinedIcon from "@material-ui/icons/RefreshOutlined";
import AccountCircleOutlinedIcon from "@material-ui/icons/AccountCircleOutlined";

import { MuiThemeProvider, createMuiTheme } from "@material-ui/core/styles";
// const OverridedInputBase = withStyles({
//   input: {
//     width: "670px",
//     minWidth: "80px",
//     marginTop:"1%"
//   }
// })(InputBase);

const theme = createMuiTheme({
  overrides: {
    MuiPaper: {
      elevation4: {
        boxShadow:
          "0px 3px 0px -3px rgba(0,0,0,0.2), 0px 4px 5px 0px rgba(0,0,0,0.14), 0px 1px 10px 0px rgba(0,0,0,0.12)"
      }
    },

    MuiDrawer: {
      paper: {
        top: "13%"
      }
    },

    PersistentDrawerLeft: {
      drawer: {
        width: "0px"
      }
    }
  }
});

class Dashboard extends Component {
  constructor(props) {
    super(props);

    this.state = {
      anchorEl: null
    };
  }

  render() {
    let isMenuOpen = Boolean("anchorEl");
    return (
      <div className="mainDashboard">
        <MuiThemeProvider theme={theme}>
          <AppBar position="fixed">
            <Toolbar className="toolbar" style={{ backgroundColor: "white" }}>
              <div className="keepAndLogo" style={{ width: "17%" }}>
                <IconButton color="inherit" aria-label="Open drawer">
                  <MuiThemeProvider theme={theme}>
                    {" "}
                    <Drawer />
                  </MuiThemeProvider>
                </IconButton>
                <img
                  src={keeplogo}
                  width="22%"
                  height="10%"
                  alt="hello"
                  style={{ paddingTop: "12%" }}
                ></img>
                <Typography
                  className="keep"
                  variant="h6"
                  color="inherit"
                  noWrap
                >
                  <b style={{ marginLeft: "2%" }}>Keep</b>
                </Typography>
              </div>

              <div className="dashboardSearch">
                <div className="dashboardsearchicon">
                  <SearchIcon />
                </div>
                <div style={{ width: "90%" }}>
                  <InputBase
                    color="white"
                    placeholder="Search…"
                    style={{
                      justifyContent: "start",
                      display: "flex",
                      top: "13%"
                    }}
                  />
                </div>
              </div>

              <div className="logokeep1">
                <RefreshOutlinedIcon />
                <img src={keep1} width="22px" height="22px" alt="hello"></img>
                <SettingsOutlinedIcon />
              </div>
              <div>
                <AccountCircleOutlinedIcon />
              </div>
            </Toolbar>
          </AppBar>
        </MuiThemeProvider>
      </div>
    );
  }
}

export default Dashboard;
